import React from "react";

export default function WhoAre() {
  return (
    <div className="whoAreBox">
      <h1 className="hoverTitle"> Who we are?</h1>
      <p className="hoverText">
        Especialistas en tecnología y desarrollo de software. Desarrollamos tu
        web personal o aplicación móvil, de acuerdo a los requerimentos
        específicos que tu emprendimiento necesita. Nos especializamos en
        pequeños proyectos ya que nuestro objetivo principal es ayudar a
        pequeños emprendedores que estan iniciando un negocio y por ello nuestra
        tarifa es reducida y adaptada a las posibilidades de cada cliente
      </p>
    </div>
  );
}
